The plate, with the exception of a plate and a couple of other small pieces, is made of sheet metal. There are four parts:

Plate 1: The plate is a sheet of 3/4 inch (80 mm) steel. It has the nameplate on the lower edge of the plate. This plate was made by the Swedish steel company Tynsk, in the United States, and the first sheet of the plate was used in the 1873 war. This plate was also used by the United States during the Spanish-American War. The nameplate was used by the US government in 1892 and the plates were used by the United States until the mid-1930s.
